"    12-lead electrocardiogram (ECG) showing ventricular tachycardia in arrhythmogenic right ventricular cardiomyopathy (ARVC)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 444px; height: 261px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Ventricular tachycardia in arrhythmogenic right venricular cardiomyopathy (ARVC) usually arises from the free wall of the right ventricle, resulting in a left bundle branch morphology.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     With permission from Podrid, PJ, Kowey, PR (Eds), Cardiac Arrhythmia - Mechanisms, Diagnosis, and Management, Williams &amp; Wilkins, Baltimore, 1995.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 594px\">",
"   <div class=\"ttl\">",
"    Normal ECG",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 594px; height: 337px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Normal electrocardiogram showing normal sinus rhythm at a rate of 75 beats/min, a PR interval of 0.14 sec, a QRS interval of 0.10 sec, and a QRS axis of approximately 75&deg;.",
